import React from 'react';
import './App.scss';
import FetchCharacters from './services/FetchCharacters';

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      characters: []
    };
  }

  componentDidMount() {
    FetchCharacters();
  }

  render() {
    return <div className="App" />;
  }
}

export default App;
